üçÉ
Last year it was closed for redevelopment as an ‚ÄúEco-Tourism Destination‚Äù. My heart sank when I heard this, and luckily was able to get up there the week before they closed, which is when I took this photo. I was afraid the redevelopment would destroy the things I loved about camping up there. Well it‚Äôs just been reopened and what I‚Äôd not counted on was the price to camp to increase so exponentially that it‚Äôs completely taken it out of my ability to go there by myself anymore. 
üçÉ
The starting price for a tent site is now $40 a night! That is 6 times the cost it used to be, for the same patch of ground for me to pitch my tent. What makes me angry is the @qldgov contributed $1.2 million towards this redevelopment, so some of my tax dollars have gone towards taking my favourite camping spot out of my reach. Awesome. And right at a time when so much else has already been taken out of my reach. And even worse, it sounds as though this is only the beginning of the government converting @qldparks National Parks into 
‚ÄúEco-Tourism Destinations‚Äù. 
üçÉ
Since when are National Parks primarily about tourism? I thought they were to protect and preserve the environment and be places for the people (ALL people, not just those with $$) to share and experience these beautiful places outdoors. I am pretty upset that the Qld government is starting to take these places away from everyone and making them instead all about tourism. üò•";}i:186;a:1:{s:14:"comments_count";i:2;}i:187;a:1:{s:11:"likes_count";i:12;}i:188;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEu3BpFJWa_";}i:189;a:1:{s:5:"image";s:248:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/118768823_685721895364467_244601798454818754_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=103&_nc_ohc=q7njCdr8S48AX8fBDnW&oh=85c46fd2e21a796f93848b70078e8acf&oe=5F7D5B38";}i:190;a:1:{s:4:"type";s:5:"image";}i:191;a:1:{s:8:"owner_id";i:209479879;}i:192;a:1:{s:14:"owner_username";s:0:"";}i:193;a:1:{s:14:"owner_fullname";s:0:"";}i:194;a:1:{s:9:"owner_pic";s:0:"";}i:195;a:1:{s:2:"id";s:19:"2391089759174110129";}i:196;a:1:{s:10:"short_code";s:11:"CEu23eppaux";}i:197;a:1:{s:12:"created_time";i:1599260133;}i:198;a:1:{s:7:"caption";s:1399:"Beyond proud and honored for being part of this wonderful gallery!!! Thanks A LOT üôáüèº‚Äç‚ôÄÔ∏èüôèüèªü•∞üéâüéäüôáüèº‚Äç‚ôÄÔ∏è @shot_4_spot
